import ReactSwitch from 'react-switch';
function App() {
  return (
    <>
      <Router>
        <ReactSwitch>

        </ReactSwitch>
          <Routes path='/login'>
            <Login/>
          </Routes>
      </Router>
      <Headers />
    </>
  );
}

export default App;
